●極細毛ともっちりホイップ泡でお顔のすみずみまで毛穴汚れスッキリ！<br><br>

●極細でやわらかい肌ざわりの「カネゴート」を100％使用した洗顔ブラシです。指では届かない毛穴の奥の汚れを優しくかき出し、化粧ノリの良い、ツルツル・クリア肌に整えます。<br><br>

●「カネゴート」100％採用！<br>
山羊毛のやわらかさをイメージして作られた極細の繊維です。髪の毛より細い50ミクロンの毛が、毛穴の奥まで密着。うっとりするようなブラッシング効果で肌をツルツルに磨きあげます。<br><br>

●独自の植毛配列！<br>
毛穴への密着感はもちろん、泡立ちの良さにもこだわりました。乾きも早いので衛生的です。<br><br>

●普段の洗顔にプラスするだけ！<br>
お手持ちの洗顔料を使って普段の洗顔にプラスするだけでOK<br><br>

●乾かす時に便利な紐付き！

