●国産「天然シルク地」100％採用！絹繊維の断面は三角形で、その細さは髪の毛の約1／30。指では届かない毛穴の奥まで入り込み、汚れをかき出し、ツルツルのお肌に磨きあげます。<br><br>

●天然保湿成分セリシンの効果で、やさしい肌触りの素材です。<br><br>

●泡立てスポンジ内蔵で、泡立ちもふんわり。<br><br>

