●忙しい朝ももちもち炭酸泡を、肌にのせてくるくる洗顔するだけで、マッサージ＆パック効果！<br><br>

●くすみの原因メラニンを含む古い角質・毛穴の汚れもスッキリ！<br><br>

●夜はクレンジングとして、メイクも落とせます。（Ｗ洗顔不要）<br><br>

●メキメキ★美肌を育む保湿成分　「肌飲み」アクアプラセンタ*1 100mg配合<br><br>

●さらなる美肌のための保湿成分「3つのヒアルロン酸*2」と「アセロラエキス」配合<br><br>

●無着色・無効物油・パッチテスト済み*3・天然のほのかなアロマ<br><br>

*1　プラセンタエキス：保湿成分<br>
*2　ナノヒアルロン酸（加水分解ヒアルロン酸）、スーパーヒアルロン酸（アセチルヒアルロン酸Na）、吸着型ヒアルロン酸（ヒアルロン酸ヒドロキシプロピルトリモニウム）<br>
*3　パッチテストとは、お肌に化粧品を貼ってテストする方法です。
